import{_ as s,c as a,o as n,a as l}from"./app.536cdada.js";const h=JSON.parse('{"title":"Linux 子系统的迁移","description":"","frontmatter":{},"headers":[{"level":2,"title":"简介","slug":"简介","link":"#简介","children":[]},{"level":2,"title":"迁移前准备","slug":"迁移前准备","link":"#迁移前准备","children":[]},{"level":2,"title":"导出对应的分发版本","slug":"导出对应的分发版本","link":"#导出对应的分发版本","children":[]},{"level":2,"title":"注销原有分发版本记录","slug":"注销原有分发版本记录","link":"#注销原有分发版本记录","children":[]},{"level":2,"title":"重新导入分发版本","slug":"重新导入分发版本","link":"#重新导入分发版本","children":[]},{"level":2,"title":"重新确定登录用户","slug":"重新确定登录用户","link":"#重新确定登录用户","children":[]}],"relativePath":"Topic/Windows/Virtual-Machine/How-to-migrate-WSL.md","lastUpdated":1678597845000}'),e={name:"Topic/Windows/Virtual-Machine/How-to-migrate-WSL.md"},o=l(`<h1 id="linux-子系统的迁移" tabindex="-1">Linux 子系统的迁移 <a class="header-anchor" href="#linux-子系统的迁移" aria-hidden="true">#</a></h1><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-hidden="true">#</a></h2><p>在使用 <code>Windows Subsystem for Linux</code> (以下简称为 <code>WSL</code>) 的时候，其一般情况下是安装在系统盘 <code>C</code> 盘，但是就像安装一些应用程序一样，很多时候我们并不想将其安装在这里，所以很多时候我们需要对 <code>WSL</code> 进行迁移。</p><h2 id="迁移前准备" tabindex="-1">迁移前准备 <a class="header-anchor" href="#迁移前准备" aria-hidden="true">#</a></h2><p>在迁移前我们首先要需要将当前正在运行的 <code>WSL</code> 停止运行，对应的命令行如下：</p><div class="language-ps"><button title="Copy Code" class="copy"></button><span class="lang">ps</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#A6ACCD;">wsl </span><span style="color:#89DDFF;">--</span><span style="color:#A6ACCD;">shutdown</span></span>
<span class="line"></span></code></pre></div><h2 id="导出对应的分发版本" tabindex="-1">导出对应的分发版本 <a class="header-anchor" href="#导出对应的分发版本" aria-hidden="true">#</a></h2><p>在停止了对应的分发版本后，我们还需要进行<strong>对应分发版本</strong>的导出，对应命令行如下：</p><div class="language-ps"><button title="Copy Code" class="copy"></button><span class="lang">ps</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#A6ACCD;">wsl </span><span style="color:#89DDFF;">--</span><span style="color:#A6ACCD;">export </span><span style="color:#89DDFF;">&lt;</span><span style="color:#A6ACCD;">DistributionName</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;/</span><span style="color:#A6ACCD;">path</span><span style="color:#89DDFF;">/</span><span style="color:#A6ACCD;">to</span><span style="color:#89DDFF;">/</span><span style="color:#89DDFF;font-style:italic;">where</span><span style="color:#89DDFF;">/</span><span style="color:#A6ACCD;">u</span><span style="color:#89DDFF;">/</span><span style="color:#A6ACCD;">want</span><span style="color:#89DDFF;">/</span><span style="color:#A6ACCD;">to</span><span style="color:#89DDFF;">/</span><span style="color:#A6ACCD;">save</span><span style="color:#89DDFF;">&gt;</span></span>
<span class="line"><span style="color:#676E95;font-style:italic;"># For example:</span></span>
<span class="line"><span style="color:#676E95;font-style:italic;"># wsl --export Ubuntu D:/export.tar</span></span>
<span class="line"></span></code></pre></div><p>查看系统内已有所有的分发版本的命令行如下：</p><div class="language-ps"><button title="Copy Code" class="copy"></button><span class="lang">ps</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#A6ACCD;">wsl </span><span style="color:#89DDFF;">--</span><span style="color:#A6ACCD;">list</span></span>
<span class="line"></span></code></pre></div><h2 id="注销原有分发版本记录" tabindex="-1">注销原有分发版本记录 <a class="header-anchor" href="#注销原有分发版本记录" aria-hidden="true">#</a></h2><p>导出完毕之后，我们要做的就是将原有的分发版本的记录进行注销，对应命令行命令如下：</p><div class="language-ps"><button title="Copy Code" class="copy"></button><span class="lang">ps</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#A6ACCD;">wsl </span><span style="color:#89DDFF;">--</span><span style="color:#A6ACCD;">unregister </span><span style="color:#89DDFF;">&lt;</span><span style="color:#A6ACCD;">DistributionName</span><span style="color:#89DDFF;">&gt;</span></span>
<span class="line"></span></code></pre></div><h2 id="重新导入分发版本" tabindex="-1">重新导入分发版本 <a class="header-anchor" href="#重新导入分发版本" aria-hidden="true">#</a></h2><p>注销完毕之后，我们选定一个新的位置，并将其重新导入，对于命令行如下：</p><div class="language-ps"><button title="Copy Code" class="copy"></button><span class="lang">ps</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#A6ACCD;">wsl </span><span style="color:#89DDFF;">--</span><span style="color:#A6ACCD;">import </span><span style="color:#89DDFF;">&lt;</span><span style="color:#A6ACCD;">DistributionName</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#A6ACCD;">path</span><span style="color:#89DDFF;">/</span><span style="color:#A6ACCD;">to</span><span style="color:#89DDFF;">/</span><span style="color:#A6ACCD;">new</span><span style="color:#89DDFF;">/</span><span style="color:#A6ACCD;">dirctory</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;/</span><span style="color:#A6ACCD;">path</span><span style="color:#89DDFF;">/</span><span style="color:#A6ACCD;">to</span><span style="color:#89DDFF;">/</span><span style="color:#89DDFF;font-style:italic;">where</span><span style="color:#89DDFF;">/</span><span style="color:#A6ACCD;">u</span><span style="color:#89DDFF;">/</span><span style="color:#A6ACCD;">saved</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">--</span><span style="color:#A6ACCD;">version </span><span style="color:#F78C6C;">2</span></span>
<span class="line"><span style="color:#676E95;font-style:italic;"># For example:</span></span>
<span class="line"><span style="color:#676E95;font-style:italic;"># wsl --import Ubuntu D:\\export\\ D:\\export.tar --version 2</span></span>
<span class="line"></span></code></pre></div><h2 id="重新确定登录用户" tabindex="-1">重新确定登录用户 <a class="header-anchor" href="#重新确定登录用户" aria-hidden="true">#</a></h2><p>在重新导入对应分发版本之后，我们再次登录对应版本之后可能遇到对应子系统的默认登陆用户并非自己之前设定的问题，此时我们需要对对应分发版本重新设置默认登陆用户，请参考 <a href="./Introduction-of-WSL2">Linux 子系统 </a> 一文中的介绍。</p>`,19),p=[o];function t(c,r,i,D,d,y){return n(),a("div",null,p)}const F=s(e,[["render",t]]);export{h as __pageData,F as default};
